import { defineMessages } from 'react-intl';

export const scope = 'app.containers.Footer';

export default defineMessages({
  copyright: {
    id: `${scope}.copyright`,
    defaultMessage: 'Copyright',
  },
  allRightsReserved: {
    id: `${scope}.allRightsReserved`,
    defaultMessage: 'All rights reserved.',
  },
  garaazLink: {
    id: `${scope}.garaazLink`,
    defaultMessage: 'Garaaz',
  },
  svanAutotech: {
    id: `${scope}.svanAutotech`,
    defaultMessage: 'SVAN Autotech Pvt. Ltd.',
  },
  aboutUsLink: {
    id: `${scope}.aboutUsLink`,
    defaultMessage: 'About Us',
  },
  contactUsLink: {
    id: `${scope}.contactUsLink`,
    defaultMessage: 'Contact Us',
  },
  licensesLink: {
    id: `${scope}.licensesLink`,
    defaultMessage: 'Licenses',
  },
  blogLink: {
    id: `${scope}.blogLink`,
    defaultMessage: 'Blog',
  },
});
